import React, { Component } from 'react';
import { Text, ScrollView, Button, StyleSheet } from 'react-native';

class HomeScreen extends Component {
  // Button/Text box to add a post

  render() {
    return <ScrollView style={styles.backgrd} />;
  }
}

const styles = StyleSheet.create({
  topButtonContainer: {
    alignContent: 'center',
    flexDirection: 'row',
  },

  standardButton: {
    margin: 'auto',
    marginTop: '10px',
    backgroundColor: 'white',
    color: '#ffcc0e',
    borderColor: '#ffcc0e',
    borderWidth: '2px',
    padding: '7.5px',
    borderRadius: '5px',
    width: '40%',
    textAlign: 'center',
  },

  image: {
    height: '100px',
    width: '100px',
    borderRadius: '50px',
  },

  header: {
    fontWeight: 'bold',
    alignContent: 'center',
    margin: 'auto',
    textAlign: 'center',
    padding: 5,
  },

  listItem: {
    borderColor: '#ffcc0e',
    borderWidth: '10px',
    margin: '10px',
    padding: '5px',
    borderRadius: '20px',
    alignItems: 'left',
    justifyContent: 'center',
  },

  listLink: {
    color: '#000000',
    textAlign: 'right',
  },

  listName: {
    fontSize: '20px',
    fontWeight: 'bold',
    textAlign: 'left',
    padding: 5,
  },
});

export default HomeScreen;
